script: |
  super -f text -I q6635.spq | sort > q6635.out

inputs:
  - name: q6635.spq
    data: |
      SELECT - + col0 * + ( - + col0 ) AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - + ( 39 ) BETWEEN + col1 + 58 * col1 * - ( - 58 ) * col0 AND + ( - + col0 );
  - name: tab2

outputs:
  - name: q6635.out
    data: |
      2116
      4096
      5625
